contracts/RugPullDetector.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title RugPullDetector
 * @dev Contract for detecting potential rug pulls on Stacks blockchain
 */
contract RugPullDetector is Ownable {
    // Events
    event TokenAnalyzed(address indexed tokenAddress, bool isPotentialRugPull, string[] reasons);
    event RiskFactorAdded(string name, uint256 weight);
    event RiskFactorRemoved(string name);
    event RiskFactorWeightUpdated(string name, uint256 newWeight);

    // Structs
    struct TokenAnalysis {
        bool analyzed;
        bool isPotentialRugPull;
        string[] riskFactors;
        uint256 riskScore;
        uint256 timestamp;
    }

    struct RiskFactor {
        bool exists;
        uint256 weight; // 1-100
    }

    // State variables
    mapping(address => TokenAnalysis) public tokenAnalyses;
    mapping(string => RiskFactor) public riskFactors;
    string[] public riskFactorNames;

    uint256 public rugPullThreshold;
    address[] public analyzedTokens;

    // Constructor
    constructor(uint256 _rugPullThreshold) Ownable(msg.sender) {
        rugPullThreshold = _rugPullThreshold;

        // Initialize default risk factors
        _addRiskFactor("No liquidity lock", 80);
        _addRiskFactor("Owner can mint unlimited tokens", 90);
        _addRiskFactor("Hidden mint functions", 95);
        _addRiskFactor("Blacklist functions", 60);
        _addRiskFactor("Transfer fees over 10%", 70);
        _addRiskFactor("Owner can pause trading", 75);
        _addRiskFactor("Proxy contract with upgradeable logic", 50);
    }

    /**
     * @dev Add a new risk factor
     * @param name Name of the risk factor
     * @param weight Weight of the risk factor (1-100)
     */
    function addRiskFactor(string memory name, uint256 weight) external onlyOwner {
        require(weight > 0 && weight <= 100, "Weight must be between 1 and 100");
        _addRiskFactor(name, weight);
    }

    /**
     * @dev Internal function to add a risk factor
     */
    function _addRiskFactor(string memory name, uint256 weight) internal {
        require(!riskFactors[name].exists, "Risk factor already exists");

        riskFactors[name] = RiskFactor({
            exists: true,
            weight: weight
        });

        riskFactorNames.push(name);
        emit RiskFactorAdded(name, weight);
    }

    /**
     * @dev Remove a risk factor
     * @param name Name of the risk factor
     */
    function removeRiskFactor(string memory name) external onlyOwner {
        require(riskFactors[name].exists, "Risk factor does not exist");

        // Find and remove from array
        for (uint256 i = 0; i < riskFactorNames.length; i++) {
            if (keccak256(bytes(riskFactorNames[i])) == keccak256(bytes(name))) {
                riskFactorNames[i] = riskFactorNames[riskFactorNames.length - 1];
                riskFactorNames.pop();
                break;
            }
        }

        delete riskFactors[name];
        emit RiskFactorRemoved(name);
    }

    /**
     * @dev Update the weight of a risk factor
     * @param name Name of the risk factor
     * @param newWeight New weight (1-100)
     */
    function updateRiskFactorWeight(string memory name, uint256 newWeight) external onlyOwner {
        require(riskFactors[name].exists, "Risk factor does not exist");
        require(newWeight > 0 && newWeight <= 100, "Weight must be between 1 and 100");

        riskFactors[name].weight = newWeight;
        emit RiskFactorWeightUpdated(name, newWeight);
    }

    /**
     * @dev Record token analysis results
     * @param tokenAddress Address of the analyzed token
     * @param detectedRiskFactors Array of detected risk factors
     */
    function recordTokenAnalysis(
        address tokenAddress,
        string[] memory detectedRiskFactors
    ) external onlyOwner {
        uint256 riskScore = 0;

        // Calculate risk score
        for (uint256 i = 0; i < detectedRiskFactors.length; i++) {
            string memory factor = detectedRiskFactors[i];
            if (riskFactors[factor].exists) {
                riskScore += riskFactors[factor].weight;
            }
        }

        // Normalize risk score to 0-100
        if (detectedRiskFactors.length > 0) {
            riskScore = riskScore / detectedRiskFactors.length;
        }

        bool isPotentialRugPull = riskScore >= rugPullThreshold;

        // Record analysis
        if (!tokenAnalyses[tokenAddress].analyzed) {
            analyzedTokens.push(tokenAddress);
        }

        tokenAnalyses[tokenAddress] = TokenAnalysis({
            analyzed: true,
            isPotentialRugPull: isPotentialRugPull,
            riskFactors: detectedRiskFactors,
            riskScore: riskScore,
            timestamp: block.timestamp
        });

        emit TokenAnalyzed(tokenAddress, isPotentialRugPull, detectedRiskFactors);
    }

    /**
     * @dev Update the rug pull threshold
     * @param newThreshold New threshold value (0-100)
     */
    function updateRugPullThreshold(uint256 newThreshold) external onlyOwner {
        require(newThreshold >= 0 && newThreshold <= 100, "Threshold must be between 0 and 100");
        rugPullThreshold = newThreshold;
    }

    /**
     * @dev Get all risk factor names
     * @return Array of risk factor names
     */
    function getRiskFactorNames() external view returns (string[] memory) {
        return riskFactorNames;
    }

    /**
     * @dev Get all analyzed tokens
     * @return Array of token addresses
     */
    function getAnalyzedTokens() external view returns (address[] memory) {
        return analyzedTokens;
    }

    /**
     * @dev Get token analysis details
     * @param tokenAddress Address of the token
     * @return analyzed Whether the token has been analyzed
     * @return isPotentialRugPull Whether the token is a potential rug pull
     * @return riskFactors Array of risk factors
     * @return riskScore Risk score (0-100)
     * @return timestamp When the analysis was performed
     */
    function getTokenAnalysis(address tokenAddress) external view returns (
        bool analyzed,
        bool isPotentialRugPull,
        string[] memory riskFactors,
        uint256 riskScore,
        uint256 timestamp
    ) {
        TokenAnalysis memory analysis = tokenAnalyses[tokenAddress];
        return (
            analysis.analyzed,
            analysis.isPotentialRugPull,
            analysis.riskFactors,
            analysis.riskScore,
            analysis.timestamp
        );
    }
}

contracts/SWatchdogRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./TransactionMonitor.sol";
import "./RugPullDetector.sol";
import "./WalletDrainerDetector.sol";

/**
 * @title SWatchdogRegistry
 * @dev Main registry contract for Stacks Watchdog security monitoring system
 */
contract SWatchdogRegistry is Ownable {
    // Events
    event SecurityAlertRaised(
        uint256 indexed alertId,
        string alertType,
        address indexed targetAddress,
        string details,
        uint256 timestamp
    );
    event MonitoringComponentUpdated(string componentName, address componentAddress);
    event AlertSubscriptionUpdated(address subscriber, bool isSubscribed);

    // Structs
    struct SecurityAlert {
        uint256 id;
        string alertType; // "suspicious_transaction", "rug_pull", "wallet_drainer"
        address targetAddress;
        string details;
        uint256 timestamp;
        bool resolved;
    }

    // State variables
    TransactionMonitor public transactionMonitor;
    RugPullDetector public rugPullDetector;
    WalletDrainerDetector public walletDrainerDetector;

    SecurityAlert[] public alerts;
    mapping(address => bool) public subscribers;
    address[] public subscriberList;

    uint256 public alertCount;

    // Constructor
    constructor(
        address _transactionMonitor,
        address _rugPullDetector,
        address _walletDrainerDetector
    ) Ownable(msg.sender) {
        transactionMonitor = TransactionMonitor(_transactionMonitor);
        rugPullDetector = RugPullDetector(_rugPullDetector);
        walletDrainerDetector = WalletDrainerDetector(_walletDrainerDetector);
        alertCount = 0;
    }

    /**
     * @dev Update a monitoring component
     * @param componentName Name of the component
     * @param componentAddress New address of the component
     */
    function updateMonitoringComponent(
        string memory componentName,
        address componentAddress
    ) external onlyOwner {
        require(componentAddress != address(0), "Invalid component address");

        if (keccak256(bytes(componentName)) == keccak256(bytes("transaction_monitor"))) {
            transactionMonitor = TransactionMonitor(componentAddress);
        } else if (keccak256(bytes(componentName)) == keccak256(bytes("rug_pull_detector"))) {
            rugPullDetector = RugPullDetector(componentAddress);
        } else if (keccak256(bytes(componentName)) == keccak256(bytes("wallet_drainer_detector"))) {
            walletDrainerDetector = WalletDrainerDetector(componentAddress);
        } else {
            revert("Unknown component name");
        }

        emit MonitoringComponentUpdated(componentName, componentAddress);
    }

    /**
     * @dev Raise a security alert
     * @param alertType Type of alert
     * @param targetAddress Address related to the alert
     * @param details Additional details about the alert
     * @return alertId ID of the created alert
     */
    function raiseSecurityAlert(
        string memory alertType,
        address targetAddress,
        string memory details
    ) external onlyOwner returns (uint256 alertId) {
        alertId = alertCount++;

        SecurityAlert memory newAlert = SecurityAlert({
            id: alertId,
            alertType: alertType,
            targetAddress: targetAddress,
            details: details,
            timestamp: block.timestamp,
            resolved: false
        });

        alerts.push(newAlert);

        emit SecurityAlertRaised(
            alertId,
            alertType,
            targetAddress,
            details,
            block.timestamp
        );

        return alertId;
    }

    /**
     * @dev Mark an alert as resolved
     * @param alertId ID of the alert
     */
    function resolveAlert(uint256 alertId) external onlyOwner {
        require(alertId < alerts.length, "Alert does not exist");
        require(!alerts[alertId].resolved, "Alert already resolved");

        alerts[alertId].resolved = true;
    }

    /**
     * @dev Subscribe to security alerts
     */
    function subscribe() external {
        require(!subscribers[msg.sender], "Already subscribed");

        subscribers[msg.sender] = true;
        subscriberList.push(msg.sender);

        emit AlertSubscriptionUpdated(msg.sender, true);
    }

    /**
     * @dev Unsubscribe from security alerts
     */
    function unsubscribe() external {
        require(subscribers[msg.sender], "Not subscribed");

        // Find and remove from array
        for (uint256 i = 0; i < subscriberList.length; i++) {
            if (subscriberList[i] == msg.sender) {
                subscriberList[i] = subscriberList[subscriberList.length - 1];
                subscriberList.pop();
                break;
            }
        }

        subscribers[msg.sender] = false;

        emit AlertSubscriptionUpdated(msg.sender, false);
    }

    /**
     * @dev Get all alerts
     * @return Array of security alerts
     */
    function getAllAlerts() external view returns (SecurityAlert[] memory) {
        return alerts;
    }

    /**
     * @dev Get all active (unresolved) alerts
     * @return Array of active security alerts
     */
    function getActiveAlerts() external view returns (SecurityAlert[] memory) {
        // Count active alerts
        uint256 activeCount = 0;
        for (uint256 i = 0; i < alerts.length; i++) {
            if (!alerts[i].resolved) {
                activeCount++;
            }
        }

        // Create array of active alerts
        SecurityAlert[] memory activeAlerts = new SecurityAlert[](activeCount);
        uint256 index = 0;
        for (uint256 i = 0; i < alerts.length; i++) {
            if (!alerts[i].resolved) {
                activeAlerts[index] = alerts[i];
                index++;
            }
        }

        return activeAlerts;
    }

    /**
     * @dev Get all subscribers
     * @return Array of subscriber addresses
     */
    function getSubscribers() external view returns (address[] memory) {
        return subscriberList;
    }

    /**
     * @dev Check if an address is on the transaction monitor watchlist
     * @param addr Address to check
     * @return isListed Whether the address is listed
     * @return category Category of the address
     */
    function isAddressOnWatchlist(address addr) external view returns (bool isListed, string memory category) {
        (isListed, category, ) = transactionMonitor.getWatchlistEntry(addr);
        return (isListed, category);
    }

    /**
     * @dev Check if a token is a potential rug pull
     * @param tokenAddress Token address to check
     * @return isPotentialRugPull Whether the token is a potential rug pull
     * @return riskScore Risk score of the token
     */
    function isTokenRugPull(address tokenAddress) external view returns (bool isPotentialRugPull, uint256 riskScore) {
        (bool analyzed, bool isRugPull, , uint256 score, ) = rugPullDetector.getTokenAnalysis(tokenAddress);

        if (!analyzed) {
            return (false, 0);
        }

        return (isRugPull, score);
    }

    /**
     * @dev Check if a contract is a wallet drainer
     * @param contractAddress Contract address to check
     * @return isDrainer Whether the contract is a drainer
     * @return drainerType Type of drainer
     */
    function isContractDrainer(address contractAddress) external view returns (bool isDrainer, string memory drainerType) {
        return walletDrainerDetector.isKnownDrainer(contractAddress);
    }
}

